import { createSlice } from '@reduxjs/toolkit'

export const counterSlice = createSlice({
  name: 'counter',
  initialState: {
    value: {}
  },
  reducers: {
    add_user: (state, user) => {
      state.user = user;
    }
  }
})

export const { add_user } = counterSlice.actions

export default counterSlice.reducer
